5.- Sous réserve des exclusions indiquées ci -dessous, les termes cires artificielles et cires 
préparées  employés  dans  le libellé  du n° 34.04,  s’appliquent  seulement  : 
a) aux produits  présentant  le caractère  des cires,  obtenus  par un procédé  chimique,  même 
solubles dans l’eau;  
b) aux produits  obtenus  en mélangeant  entre  elles différentes  cires;  
c) aux produits présentant le caractère des cires, à base de cires ou de paraffines et 
contenant, en outre, des graisses, des résines, des matières minérales ou d’autres 
matières.  
Par contre,  le n° 34.04  ne comprend  pas : 
a) les produits des  n°s 15.16,  34.02  ou 38.23, même  s’ils présentent le  caractère  des cires;  
b) les cires animales  non mélangées  et les cires végétales  non mélangées,  même  raffinées 
ou colorées, du n° 15.21;  
c) les cires  minérales  et les produits  similaires  du n° 27.12,  même  mélangés  entre  eux ou 
